cd ~/ucr/ee141/lab2/
%[text] ## part a
K = 500;
w = linspace(-pi, pi, K);

X_analytical = 1 ./ (1 - 0.8 * exp(-1j * w));
%[text] ## part b
N = 50;
n = 0:N-1;

x_n = 0.8.^n;
wn = exp(-1j*w'*n);

X_numerical = x_n * wn';
%[text] ## part c
figure;  %[output:9c4e0857]
plot(w, abs(X_analytical), 'b', 'DisplayName', 'Analytical |X(e^{j\omega})|'); %[output:9c4e0857]
hold on;  %[output:9c4e0857]
plot(w, abs(X_numerical), 'r--', 'DisplayName', 'Numerical |tilde{X}(e^{j\omega})|'); %[output:9c4e0857]
hold off;  %[output:9c4e0857]

title('Analytical vs. Numerical DTFT'); %[output:9c4e0857]
xlabel('\omega (rad/s)'); %[output:9c4e0857]
ylabel('|X(e^{j\omega})|'); %[output:9c4e0857]
legend('show');  %[output:9c4e0857]
grid on; %[output:9c4e0857]
axis([-pi pi 0 5.5]);  %[output:9c4e0857]
saveas(gcf, 'partc', 'png') %[output:9c4e0857]
%[text] ## part d
Y_analytical = 0.5 * ((1 ./ (1 - 0.7 * exp(-1j * (w - pi/6)))) + (1 ./ (1 - 0.7 * exp(-1j * (w + pi/6)))));
y_n = (0.7.^n) .* cos(pi*n/6);
Y_numerical = y_n * wn';

figure;  %[output:416ce6c9]
plot(w, abs(Y_analytical), 'b', 'DisplayName', 'Analytical |Y(e^{j\omega})|'); %[output:416ce6c9]
hold on;  %[output:416ce6c9]
plot(w, abs(Y_numerical), 'r--', 'DisplayName', 'Numerical |tilde{Y}(e^{j\omega})|'); %[output:416ce6c9]
hold off;  %[output:416ce6c9]

title('Analytical vs. Numerical DTFT'); %[output:416ce6c9]
xlabel('\omega (rad/s)'); %[output:416ce6c9]
ylabel('|Y(e^{j\omega})|'); %[output:416ce6c9]
legend('show');  %[output:416ce6c9]
grid on; %[output:416ce6c9]
axis([-pi pi 0 5.5]);  %[output:416ce6c9]
saveas(gcf, 'partd', 'png') %[output:416ce6c9]
